exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`https://www.fenghuaju.com/${bid.idPrefix()}_${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/正文<\/strong><\/div>/,"</div>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions),followCookies:!0},webview:!0})};